import React from "react";
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from "react-router-dom";
import AboutApp from "../pages/AboutApp.js";
import InfoUser from "../pages/InfoUser.js";
import MainPage from '../pages/MainPage.js'

const Router = () => (
  <BrowserRouter>
    <Switch>
      <Route path='/signIn'>
        <InfoUser/>
      </Route>
      <Route path='/info'>
        <InfoUser/>
      </Route>
      <Route path='/about'>
        <AboutApp/>
      </Route>
      <Route path=''>
        <MainPage/>
      </Route>
    </Switch>
  </BrowserRouter>
);

export default Router;
